import React, { useState, useEffect } from "react";
import CompanyProspectList from "./companyprospect.jsx";

export default function App() {
  const [darkMode, setDarkMode] = useState(false);
  const [companyName, setCompanyName] = useState("");
  const [postalCode, setPostalCode] = useState("");
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Dark mode auto (system)
    const root = window.document.documentElement;
    const saved = localStorage.getItem('darkMode');
    if (saved === 'true' || (!saved && window.matchMedia('(prefers-color-scheme: dark)').matches)) {
      setDarkMode(true);
      root.classList.add('dark');
    }
  }, []);

  const toggleDarkMode = () => {
    const root = window.document.documentElement;
    const newMode = !darkMode;
    setDarkMode(newMode);
    localStorage.setItem('darkMode', newMode);
    if (newMode) root.classList.add('dark');
    else root.classList.remove('dark');
  };

  // ... (mapCompanyData + handleSearch IDENTIQUES √† avant)

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-50 via-white to-purple-50 dark:from-slate-900 dark:via-slate-800 dark:to-indigo-900 transition-all duration-500">
      {/* üåô Toggle Dark */}
      <button
        onClick={toggleDarkMode}
        className="fixed top-6 right-6 z-50 p-3 bg-white/80 dark:bg-slate-800/80 backdrop-blur-xl rounded-2xl shadow-2xl border border-white/50 dark:border-slate-700/50 hover:scale-110 transition-all duration-300"
      >
        {darkMode ? '‚òÄÔ∏è' : 'üåô'}
      </button>

      <div className="max-w-7xl mx-auto p-6 lg:p-12">
        {/* üî• HERO SECTION */}
        <div className="text-center mb-20 animate-fade-in-down">
          <h1 className="text-6xl lg:text-7xl font-black bg-gradient-to-r from-indigo-600 via-purple-600 to-pink-600 bg-clip-text text-transparent mb-6 drop-shadow-2xl">
            Prospect'AI
          </h1>
          <p className="text-xl lg:text-2xl text-gray-700 dark:text-gray-300 max-w-2xl mx-auto leading-relaxed">
            Trouvez <strong>100+ leads B2B</strong> en 1 clic : DG, RSE, Achats avec emails/t√©l ‚úÖ
          </p>
        </div>

        {/* üì± FORM GLASS */}
        <div className="bg-white/60 dark:bg-slate-800/60 backdrop-blur-2xl rounded-3xl p-10 shadow-2xl border border-white/30 dark:border-slate-700/50 mb-20 animate-float">
          <form onSubmit={handleSearch} className="grid lg:grid-cols-4 gap-6">
            <input
              value={companyName}
              onChange={(e) => setCompanyName(e.target.value)}
              placeholder="üß† Orange"
              className="p-6 text-xl bg-white/50 dark:bg-slate-700/50 backdrop-blur-xl rounded-2xl border-2 border-indigo-200/50 dark:border-slate-600/50 focus:border-indigo-400 focus:ring-4 focus:ring-indigo-500/50 transition-all duration-300"
            />
            <input
              value={postalCode}
              onChange={(e) => setPostalCode(e.target.value)}
              placeholder="üìç 75001"
              className="p-6 text-xl bg-white/50 dark:bg-slate-700/50 backdrop-blur-xl rounded-2xl border-2 border-indigo-200/50 dark:border-slate-600/50 focus:border-indigo-400 focus:ring-4 focus:ring-indigo-500/50"
            />
            <div className="lg:col-span-2">
              <button
                type="submit"
                disabled={loading}
                className="w-full p-6 text-xl font-black bg-gradient-to-r from-indigo-600 to-purple-600 text-white rounded-2xl hover:from-indigo-700 hover:to-purple-700 shadow-2xl hover:shadow-3xl transform hover:-translate-y-2 transition-all duration-300 disabled:opacity-50 disabled:cursor-not-allowed"
              >
                {loading ? '‚ö° IA Magic...' : 'üöÄ TROUVER LEADS'}
              </button>
            </div>
          </form>
        </div>

        {/* ‚ùå Error */}
        {error && (
          <div className="p-8 mb-12 bg-red-500/10 border-2 border-red-500/30 rounded-3xl backdrop-blur-xl text-red-700 dark:text-red-300 animate-pulse">
            {error}
          </div>
        )}

        {/* ‚è≥ Loading */}
        {loading && (
          <div className="text-center py-24">
            <div className="w-24 h-24 border-4 border-indigo-500/30 border-t-indigo-500 rounded-full animate-spin mx-auto mb-8"></div>
            <p className="text-2xl font-semibold text-gray-600 dark:text-gray-400">IA scanne le web... (15s)</p>
          </div>
        )}

        {/* ‚úÖ Results */}
        {data.length > 0 && (
          <div className="animate-fade-in-up">
            <h2 className="text-4xl font-black text-center mb-16 bg-gradient-to-r from-emerald-500 to-green-600 bg-clip-text text-transparent">
              üéâ {data.length} LEADS PR√äTS !
            </h2>
            <CompanyProspectList data={data} />
          </div>
        )}
      </div>

      <style jsx global>{`
        @keyframes fade-in-down { from { opacity: 0; transform: translateY(-50px); } to { opacity: 1; transform: translateY(0); } }
        @keyframes fade-in-up { from { opacity: 0; transform: translateY(50px); } to { opacity: 1; transform: translateY(0); } }
        @keyframes float { 0%, 100% { transform: translateY(0px); } 50% { transform: translateY(-10px); } }
        .animate-fade-in-down { animation: fade-in-down 1s ease-out; }
        .animate-fade-in-up { animation: fade-in-up 1s ease-out; }
        .animate-float { animation: float 6s ease-in-out infinite; }
      `}</style>
    </div>
  );
}
